/*Tugas 1-Pertemuan 12
Program yang dapat digunakan untuk mendata hasil 
pertandingan lompat tinggi dari sejumlah peserta. 
Lalu urutkan peserta berdasarkan tinggi lompatan.*/

#include <stdio.h>//Mengakses file library stdio.h untuk fungsi input/output

void dataPeserta();

void dataPeserta()
{
 int temp, i, j, n, idx;
    printf("Masukkan jumlah peserta : ");
    scanf("%d", &n);
    printf("
");
    char nama[n];
    int hLompatan[n];
    printf("Tinggi Lompatan 
");
    for(i=0; i<n; i++)
    {
     puts("================================================");
        printf("%d Nama Peserta : ", i+1);
        scanf("%s",&nama[i]);
        printf("Tinggi Lompatan Peserta ke-%d (meter): ", i+1);
        scanf("%d", &hLompatan[i]);
        puts("================================================
");
    }
    printf("
=Sebelum di sorting=
");
    for(i=0; i<n; i++)
    {
     printf("Nama : %s 	", nama[i]);
        printf("Tinggi Lompatan : %d meter
", hLompatan[i]);
    }

    for(i=0; i<(n-1); i++)
    {
        idx=i;
        for(j=i+1; j<n; j++)
        {
            if(hLompatan[j]<hLompatan[idx])
            {
                idx=j;
            }
        }
        temp=hLompatan[i];
        hLompatan[i]=hLompatan[idx];
        hLompatan[idx]=temp;
    }

    printf("
=Setelah Sorting=
");
    for(i=0; i<n; i++)
    {
     printf("Nama : %s 	", nama[i]);
        printf("Tinggi Lompatan : %d meter
", hLompatan[i]);
    }
    printf("
");
}
void main()
{
 dataPeserta();
}

