Misal nih
```char test[256 + 10];
size_t len = 256 + 10;
char *ptr = test;
````for (; i < len; i += 256) {
 // clobber 256 bytes from ptr
 ptr += 256;
}`

Ini kalau kita unroll loopnya jadi
```/* code yang meng-clobber 256 bytes dari ptr */
ptr += 256;
/* code yang meng-clobber 256 bytes dari ptr */
ptr += 256;```

Harusnya
```/* code yang meng-clobber 256 bytes dari ptr */
ptr += 256;
/* code yang meng-clobber 10 bytes dari ptr */
ptr += 256; // unecessary, but it is safe```

Solusi:
Harusnya unroll loop juga diubah kondisi di for-nya.
`size_t vector_len = len-256;
for (; i < vector_len; i += 256) {
 // clobber 256 bytes from ptr
 ptr += 256;
}`

