Dan juga, struct yang kecil bisa dipassing via register.
Di arsitektur 64 bit, struct yang ukurannya kurang dari 64 bit bisa dipassing langsung tanpa nyentuh memory.

For example:
```struct {
  int32_t x;
  int32_t y;
};

```Kalau mau compare x dan y dengan struct yang identik, bisa langsung x dan y masuk ke 1 register 64 bit. Plus di x64 nggak pakai branching, cukup `sete` or `setne`.

Menekankan yang ini.

```#include <stdint.h>
#include <string.h>
#include <stdbool.h>

struct my_struct {
 int32_t x;
 int32_t y;
};

bool compare_a(struct my_struct a, struct my_struct b) {
 return memcmp(&a, &b, sizeof(struct my_struct)) == 0;
}

bool compare_b(struct my_struct *a, struct my_struct *b) {
 return (a->x == b->x) && (a->y == b->y);
}

```Optimized version `compare_a` cuma `cmp rdi, rsi` plus `sete` or `setne`. Sedangkan `compare_b` pasti selalu ada memory access.

Yang orang biasanya pikir itu passing pointer of struct pasti lebih murah, padahal secara ukuran structnya sendiri trivial copyable sebagai 64 bit data.

