```#include <iostream>
#include <vector>

int main(void)
{
  std::vector<std::string> my_arr = {"IT", "TEKNOLOGI", "CPP"};
  for (auto &i: my_arr) {
    std::cout << i[0] << std::endl;
  }
  return 0;
}```

In this case, `auto` is a type that the compiler can determine automatically at compile time based on the assignment or return value or iterator.

As we can see the vector is `std::vector<std::string>`, so the loop is effectively the same as:
```for (std::string &i: my_arr) {
    std::cout << i[0] << std::endl;
}```

Therefore `std::string` can be replaced with `auto`, because compiler can know what data type to iterate.

