Kalau dead object diakses lagi via pointer, itu jadi dangling pointer, otomatis undefined behavior. Nilainya bisa aja belum terclobber (atau belum reused).

Kemarin dibahas juga di grup sebelah. Kode ini:
```int *p;
{
  int a;
  p = &a;
  *p = 123; // legal
}

*p = 10; // BUG!!
printf("%d", *p); // BUG!!```

Di luar scopenya compiler boleh reuse storage variable `a`. Kalau UB tapi masih menghasilkan output yang diinginkan itu cuma beruntung aja. Don't rely on UB.

