Masih terkait dengan unspecified number of arguments, tapi spesifik ke arsitektur x86-64.

Di System V ABI kalau manggil fungsi yang parameternya tidak terspesifikasi jumlahnya, seperti contoh `type func();`, maka ABI memandatkan untuk register `%rax` harus bernilai jumlah vector register yang passing ke fungsi tersebut.

Jadi misal:
```void func();
void aaa(void)
{
  func(3, 1.0, 2.3, 10.4);
}```

Sebelum `call func`, pasti ada `mov eax, 3`. Karena ada 3 floating point yang masuk ke SSE register.

Contoh kasus yang tanpa shadowing, tidak wajib pakai spesifikasi `this->` maupun `className::.`

```class qq {
public:
  int a;
  qq(int p1) {
    a = p1;
  }
};```

Contoh begitu, ketiga assignment ini sama saja.

1)
`a = p1; // Fine`

2)
`this->a = p1; // Fine`

3)
`qq::a = p1; // Fine`

Tapi di kasus yang lain, yang ada shadowing, harus lebih spesifik merujuk ke property-nya (contoh ini mau ngeset property `a` di class `qq`).

```class qq {
public:
  int a;
  qq(int a) {
    this->a = a;
  }
};```

Contoh begitu, maka assigment ke property harus lebih eksplisit. Sehingga:

1)
`a = a; // Wrong`

2)
`this->a = a; // Fine`

3)
`qq::a = a; // Fine`

