#answer

Perhatikan codemu bagian ini:
```for (i = 0; i < vec_count; i++) {
  vec[i].iov_base = buffer + i;
  vec[i].iov_len = 4096;
}```

Berarti:
1) Tiap iovec write ke memory sebesar 4096 bytes.

2) Buffer assignment:
- iovec ke 0 write ke `&buffer[0]` sebesar 4096.
- iovec ke 1 write ke `&buffer[1]` sebesar 4096.
- iovec ke 2 write ke `&buffer[2]` sebesar 4096.
- iovec ke 3 write ke `&buffer[3]` sebesar 4096.
- dan seterusnya..

See the problem?
Tiap iovec bakal overlap dengan iovec sebelumnya. Jadi iovec 1 mengclobber iovec 0, iovec 2 mengclobber iovec 1 dan 0, iovec 3 mengclobber iovec 2, 1 dan 0, dan seterusnya...

Sama aja begini kalau pakai syscall `read` yang tanpa vector:
```for (i = 0; i < 4096; i++) {
  read(fd, &buffer[i], 4096);
}```

Seharusnya:
```for (i = 0; i < 4096; i++) {
  read(fd, &buffer[i * 4096], 4096);
}```

Jadi looping iovec mu harusnya gini:
```for (i = 0; i < vec_count; i++) {
  vec[i].iov_base = &buffer[i * 4096];
  vec[i].iov_len = 4096;
}```

